import "./style/navbar.css"
function Navbar() {
  return (
    <div>
      <header className="navbar">
        <a href="#project">Projects</a>
        <a href="#project">Projects</a>
        <a href="#skill">Skills</a>
      </header>
    </div>
  )
}

export default Navbar;
